	var bgArr = ["", bg1, bg2, bg3, bg4, bg5, bg6, bg7, bg8, bg9, bg10];

	function prePage(){

		if(nowpage*1 > 1){
			
			document.getElementById("page_"+nowpage).style.display = "none";
			nowpage--;
			document.getElementById("page_"+nowpage).style.display = "";
			document.getElementById("main").style.backgroundImage = "url('"+bgArr[nowpage]+"')";
		}
	}

	function nextPage(){		

		if(nowpage*1 < 10){
			document.getElementById("page_"+nowpage).style.display = "none";
			nowpage++;
			document.getElementById("page_"+nowpage).style.display = "";
			document.getElementById("main").style.backgroundImage = "url('"+bgArr[nowpage]+"')";
		}
	}

	function playbtn(sel){
		if(document.getElementById("b"+sel).getAttribute("rol") == 0){

			document.getElementById("m"+sel).autoplay = true;
			document.getElementById("m"+sel).load();
			document.getElementById("b"+sel).src = stopbt;
			document.getElementById("b"+sel).setAttribute("rol", 1);
		}else{
			document.getElementById("m"+sel).pause();
			document.getElementById("b"+sel).src = playbt;
			document.getElementById("b"+sel).setAttribute("rol", 0);
		}
	}

	function main(){
		for(i = 1; i < 17; i ++){
			document.getElementById("b"+i).src = playbt;
		}

		document.getElementById("main").style.backgroundImage = "url('"+bg1+"')";
		
	}
</script>
